var object = msg.payload


for (var i = 0; i < msg.payload.length; i++) {
    if (msg.payload[i].read == "y") {
        var query = {}
        query.payload = { 'fc': msg.payload[i].fun_code, 'unitid': msg.payload[i].unit_id, 'address': msg.payload[i].read_reg_id, 'quantity': msg.payload[i].addr_qty, 'datatype': msg.payload[i].read_reg_type, 'operation': 'read' };
        query.topic = { topic: msg.payload[i], error: object };

        node.send(query);
    }
}
return null;

if (msg.error === "Error: Timed out") {
 if (msg.topic && typeof msg.topic === 'object' && !Array.isArray(msg.topic)) {
    let tag = "COMM" + "." + msg.topic.topic.b + "." + msg.topic.topic.d;
    global.set(tag, 0);
  if(msg.topic.error)
  {
    for (let j = 0; j < msg.topic.error.length; j++) {
      let outMsg = {
        payload: {
          value: "NaN",
          topic: msg.topic.error[j]
        }
      };
      node.send(outMsg);
    }
  }
  }
}
else if (msg.payload && Array.isArray(msg.payload.results)) {

  let tag = "COMM" + "." + msg.topic.topic.b + "." + msg.topic.topic.d;
  global.set(tag, 1);

  for (let i = 0; i < msg.topic.error.length; i++) {
    for (let k = 0; k < msg.payload.results.length; k++) {
      if (msg.payload.results[k].address === msg.topic.error[i].read_reg_id) {
        let outMsg = {
          payload: {
            value: msg.payload.results[k].value,
            topic: msg.topic.error[i]
          }
        };
        node.send(outMsg);
      }
    }
  }
}
else if (msg.payload && msg.payload.value !== undefined) {

  let outMsg = {
    payload: {
      value: msg.payload.value,
      topic: msg.topic.topic
    }
  };
  node.send(outMsg);
}

var obj = {};
for (var i = 0; i < msg.payload.length; i++) {
